import React from 'react';

const DocumentCompleted = () => {
    return (
        <div className="container">
            <div className="document__completed">
                <p> Time </p>
                <p> Node Name </p>
                <p> Operator </p>
                <p> Operation </p>
                <p> Process Opinion </p>

            </div>
        </div>
    );
};

export default DocumentCompleted;
